<template>
<div class="hello">
    <div class="demo-ruleForm">
        <div class="form-title">
            Assistant Login
        </div>
        <div class="form-item">
            <el-input placeholder="Username" prefix-icon="el-icon-login-user" v-model="props.username">
            </el-input>
        </div>
        <div class="form-item">
            <el-input type="password" placeholder="Password" prefix-icon="el-icon-login-password" v-model="props.password">
            </el-input>
        </div>
        <div class="form-item">
            <el-button type="primary" @click="login">Login</el-button>
        </div>
    </div>
</div>
</template>

<script>
import API from '../api/api_user'
export default {
    name: 'Login',
    data() {
        return {
            props: {
                username: '',
                password: '',
            }
        };
    },
    methods: {
        login() {
            var uPattern = /^[a-zA-Z0-9_-]{4,16}$/; // 用户名正则，4到16位（字母，数字，下划线，减号）
            var aPattern = /^[a-zA-Z0-9]{4,16}$/; // 密码正则，4到16位（字母，数字）
            if (!uPattern.test(this.props.username)) {
                this.$message.error('用户名输入错误');
            } else if (!aPattern.test(this.props.password)) {
                this.$message.error('密码输入错误');
            } else {
                API.login({
                    username: this.props.username,
                    password: this.props.password
                }).then(res => {
                    if (res.code == '0') {
                        this.$message({
                            message: '登录成功',
                            type: 'success'
                        });
                        this.$router.push({
                            name: 'index'
                        })
                    } else {
                        this.$message.error('登录失败，请重试');
                    }
                })
                // API.userList().then(res=>{
                //     console.log(res)
                // })
                // API.userDetail({id:1}).then(res=>{
                //     console.log(res)
                // })
                let parasms = {
                    username: "patricia123",
                    password: "123456",
                    student_id: "E1234567F",
                    name: "patricia",
                    avatar: "",
                    gender: "F",
                    phone: "98765434",
                    email: "patricia123@gmail.com",
                    academic_year: "4",
                    department: "Engineering",
                    course: "Data and Information Systems"
                }
                // API.addUser(parasms).then(res=>{
                //     console.log(res)
                // })
            }
        }
    }
}
</script>

